import ReactDOM from 'react-dom'
import App from './App'

import axios from 'axios';

axios
  .get('http://localhost:3001/notes')
  .then(response => {
    let notes = response.data;
    ReactDOM.render(
      <App notes={notes} />,
      document.getElementById('root')
    )
  });

